import React from 'react';
import ImgLogon from '../../../assets/img/logon.jpg'
export default function DashBoardv2() {
    return (        
        <div>  
            <div>
                <img src={ImgLogon} alt="Imagem de Logon" />                                        
            </div>
        </div>     
    );    
}
